query.sparql:
SELECT DISTINCT ?uri 
WHERE { 
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Country> . ?cave <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Cave> . { ?cave <http://dbpedia.org/ontology/location> ?uri . } UNION { ?cave <http://dbpedia.org/ontology/location> ?loc . ?loc <http://dbpedia.org/ontology/country> ?uri . } } GROUP BY ?uri HAVING(COUNT(?cave) > 10)

SELECT DISTINCT ?uri 
WHERE { 
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/River> . 
      { ?uri <http://dbpedia.org/ontology/length> ?l . } 
      UNION 
      { ?uri <http://dbpedia.org/property/length> ?l . } 
} ORDER BY DESC(?l) 
OFFSET 0 LIMIT 1

SELECT DISTINCT ?uri 
WHERE { 
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Automobile> . 
      { ?uri <http://dbpedia.org/ontology/assembly> <http://dbpedia.org/resource/Germany> . } 
      UNION 
      { ?uri <http://dbpedia.org/property/assembly> <http://dbpedia.org/resource/Germany> . } 
      UNION 
      { { ?uri <http://dbpedia.org/ontology/manufacturer> ?x . } 
        UNION 
        { ?uri <http://dbpedia.org/property/manufacturer> ?x . } 
        { ?x <http://dbpedia.org/ontology/locationCountry> <http://dbpedia.org/resource/Germany> . } 
        UNION 
        { ?x <http://dbpedia.org/ontology/location> <http://dbpedia.org/resource/Germany> . } 
      } 
}

SELECT DISTINCT ?uri 
WHERE { 
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/StatesOfTheUnitedStates> . 
        ?uri <http://dbpedia.org/property/admittancedate> ?x . 
} ORDER BY DESC(?x) 
OFFSET 0 LIMIT 1

SELECT COUNT(DISTINCT ?uri)
WHERE { 	
        ?uri  <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Organisation>  .
      { ?uri <http://dbpedia.org/ontology/industry> <http://dbpedia.org/resource/Telecommunication> . } 
      UNION 
      { ?uri <http://dbpedia.org/property/industry> ?industry . 
        FILTER (regex(?industry,'Telecommunications')) . }
      { ?uri <http://dbpedia.org/ontology/location> <http://dbpedia.org/resource/Belgium>. } 
      UNION 
      { ?uri <http://dbpedia.org/property/locationCountry> 'Belgium'@en . }
}

SELECT DISTINCT ?uri
WHERE {
         ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Person> .
         ?uri <http://dbpedia.org/ontology/office> '1st President of the United States'@en .
}

SELECT DISTINCT ?uri
WHERE { 
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Airport> .
      { ?uri <http://dbpedia.org/ontology/location> <http://dbpedia.org/resource/California> . }
      UNION
      { ?uri <http://dbpedia.org/ontology/city> <http://dbpedia.org/resource/California> . } 
      UNION 
      { ?uri <http://dbpedia.org/ontology/city> ?city .
        ?city <http://dbpedia.org/ontology/isPartOf> <http://dbpedia.org/resource/California> . }
      UNION
      { ?uri <http://dbpedia.org/ontology/operator> <http://dbpedia.org/resource/California> . } 
}

SELECT DISTINCT ?uri 
WHERE {
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Organisation> .
      { ?uri <http://dbpedia.org/ontology/formationYear> ?date . }
      UNION 
      { ?uri <http://dbpedia.org/ontology/foundingYear> ?date. }
      FILTER regex(?date,'^1930') . 
}
